ライラクス
<br><br>
東京マルイ ブローバックガスガン用
<br><br>

縮み易く、伸び側への押しが強いノンライナー形状<br>
接触面で発生する不要なストレスを排除し、<br>
スプリング性能を引き出す摩擦軽減のテフロン加工を採用！<br>
ハンマーからマガジンバルブへインパクトするスピードを維持し、<br>
様々な条件下でもスライド動作への影響や無駄なガス放出を抑え、<br>
一連のブローバックギミックを速くかつマイルドにするバランスの取れたアイテムです
<br><br>
